import React, { Component } from "react";
import Toolbar from '../toolbar/toolbar';

class Builder extends Component {
  render() {
    return (
      <div className="App">
        <div id="toolbar"><span className="toolbarItem">+ Add Menu</span>|<span className="toolbarItem">+ Add Item</span></div>
        <div id="venderSplash">
          <div>
            <h1>Builder App</h1>
          </div>
        </div>
      </div >
    )
  };
}

export default Builder;
